      SELECT ALL - - col2 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT NULL BETWEEN - col0 / + 91 - + - 12 * - 36 AND col0 * + 64 * + - ( col2 );
  - name: tab0

outputs:
  - name: q9814.out
    data: |
